[Jadi Topik Hangat, Netizen Korea Dibuat Terpana Oleh Rambut Panjang Hyunjin Stray Kids]
.
Nampaknya netizen belum bisa "move on" dari rambut panjang Hyunjin Stray Kids. Belum lama ini, nama Hyunjin menjadi topik hangat di situs Pann karena rambut panjangnya tersebut.
.
Seperti yang diketahui bahwa selama masa promosi "God's Menu", Hyunjin memanjangkan rambutnya dan bahkan mengikatnya dibelakang hingga memberikan kesan maskulin pada penampilannya.
.
Tak banyak idol yang dinilai bisa membuat bagus rambut ini, namun netizen dibuat terpana karena Hyunjin bisa melakukannya. Baik OP maupun netizen lain membanjiri reaksi positif di kolom komentar.
.
Begini kata mereka:
1. Wajah tampan seperti aktor + aura dark dengan rambut panjang seperti idol hip hop + terlihat keren sekali.
2. Dia terlihat sangat tampan.
3. Ada banyak idol dengan rambut panjang namun mereka lebih cocok dengan rambut pendek, tapi Hyunjin memiliki aura dan wajah yang tajam, sehingga ia terlihat lebih berkarisma dengan rambut panjang daripada dengan rambut pendek.
4. Tampan, ia terlihat seperti dewa pria dari mitos romawi Yunani.
5. Biasanya jika kamu atau teman mu punya rambut panjang, maka akan meninggalkan kesan negatif. Tapi jujur aku menyukai orang ini.
6. Jujur sebetulnya aku tidak suka melihat idol pria dengan rambut panjang. Menurutku itu sangat mengganggu dan tidak enak dilihat tapi saya berubah pikiran ketika melihat foto-foto dan gif ini..
.
